import React from 'react'
const Header = (props) => {
  return(
    <div>
      <h1>
       { props.course }
      </h1>
    </div>
  )
}
const Content = (props) => {
  return(
    <div>
      <Part part={props.part1} exercises={props.exercises1}></Part>
      <Part part={props.part2} exercises={props.exercises2}></Part>
      <Part part={props.part3} exercises={props.exercises3}></Part>
    </div>
  )
}
const Total = (props) => {
  return(
    <div>
      <p>Number of exercises {props.exercises1 + props.exercises2 + props.exercises3}</p>
    </div>
  )
}
const Part = (props) =>{
  return(
    <div>
      <p>
          {props.part} {props.exercises}
        </p>
    </div>
  )
}
const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]
  return (
    <div>
      <Header course={course}></Header>
      <Content part1={parts[1].name} exercises1={parts[1].exercises} part2={parts[2].name} exercises2={parts[2].exercises} part3={parts[3].name} exercises3={parts[3].exercises}></Content>
      <Total exercises1={parts[1].exercises} exercises2={parts[2].exercises} exercises3={parts[3].exercises}></Total>
    </div>
  )
}

export default App;
